import React from 'react'
import { withTranslation } from 'react-i18next';


function Home({t}) {




  return (
    <div className="App">
      <div className="App-header">
        <h1>Hola soy {t('title')}</h1>
      </div>
    </div>
  )
}

export default withTranslation('homePage')(Home);
